import meals from '../../assets/meals.jpg'
import classes from './Header.module.css'
const Header=()=>{
return (
    <>
        <header className={classes.header}>
            <h1>OnWay</h1>
            <button>Cart</button>
        </header>
        <div>
            <img src={meals} alt="A table full of delicious food"/>
        </div>
    </>
)
}

export default Header;
